import React from "react";
import CVForm from "../components/CVForm";
import { createCV } from "../services/api";
import Navbar from "../components/Navbar";
import { useNavigate } from "react-router-dom";

function UserCV() {
  const navigate = useNavigate();

  const handleCVSubmit = (data) => {
    // Hent brukerens ID fra localStorage
    const currentUserId = localStorage.getItem("userId");

    // Debugging for 책 sjekke om userId er korrekt
    console.log("Current User ID:", currentUserId); // Logg userId for 책 se om den er korrekt

    if (!currentUserId) {
      alert("Brukeren er ikke logget inn.");
      navigate("/login");
      return;
    }

    const newCv = {
      ...data,
      userId: currentUserId, // Legg til brukerens ID
    };

    console.log("New CV Data:", newCv); // Verifiser at userId er lagt til korrekt

    createCV(newCv)
      .then((response) => {
        console.log("CV opprettet:", response);
        // Naviger til en annen side etter at CV er opprettet, f.eks. dashboardet
        navigate("/dashboard");
      })
      .catch((error) => {
        console.error("Feil ved oppretting av CV:", error);
        alert("Kunne ikke opprette CV");
      });
  };

  return (
    <div className="p-6">
      <Navbar />
      <h1 className="mb-4 text-3xl font-semibold">Min CV</h1>
      <CVForm onSubmit={handleCVSubmit} />
    </div>
  );
}

export default UserCV;
